import styled from "styled-components";

export const Back = styled.div`
  height: 100vh;
  width: 100vw;
  display: flex;
  flex
  backgroundimage: {{ img }};
  font-size: 48;
  font-family: "Oswald", sans-serif;
  font-weight: bold;
  color: #096192;
`;
